import { Routes, Route } from "react-router-dom";
import Editor from "./pages/editor";

function TestLink() {
    return (<h2> Now test link has been rendered! </h2>);
  }

  function Home() {
    return (<h2> ALL FILES </h2>);
  }

// All the places you can go!
const AllRoutes = () => {
  return (
    <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/editor" element={<Editor title="hello" code="oiakdjflakdsjflajsdkflasd"/>} />
        <Route path="/test" element={<TestLink />}/>
    </Routes>
  );
}; 

export default AllRoutes;
